import React, { Component } from "react";

class Education extends Component {
  constructor() {
    super();

    this.state = {};
  }

  render() {
    return (
      <form className="education">
        <input type="text" className="education-input" />
        <input type="text" className="education-input" />
        <input type="text" className="education-input" />
        <input type="text" className="education-input" />
        <input type="text" className="education-input" />
        <input type="text" className="education-input" />
        <button type="button">Delete</button>
      </form>
    );
  }
}

export default Education;
